svg.script:
function ocultarSelect() {
        document.getElementById("Contato").style.display = "none";
        document.getElementById("selectCadastrar").style.display = "none";
        document.getElementById("selectExcluir").style.display = "none";
        document.getElementById("selectSobre").style.display = "none";
        document.getElementById("selectSobre_1_").style.display = "none";
        document.getElementById("selectProdutos").style.display = "none";
    }

    function mostrarContato() {
	document.getElementById("Contato").style.display = "block";
    }

    function mostrarProdutos() {
	document.getElementById("selectProdutos").style.display = "block";
    }

    function mostrarSobre() {
	document.getElementById("selectSobre").style.display = "block";
        document.getElementById("selectSobre_1_").style.display = "block";
    }

    function mostrarExcluir() {
	document.getElementById("selectExcluir").style.display = "block";
    }

    function mostrarCadastrar() {
	document.getElementById("selectCadastrar").style.display = "block";
    }


    function clicarContatos() {
	window.parent.document.getElementById("Contato").style.display = "block";
        window.parent.document.getElementById("telaEscura").style.display = "block";
    }

    function clicarSobre() {
	window.parent.document.getElementById("Sobre").style.display = "block";
        window.parent.document.getElementById("telaEscura").style.display = "block";
        window.parent.document.getElementById("Contato").style.display = "none";
    }

    function clicarProduto() {
	window.parent.document.getElementById("Produtos").style.display = "block";
        window.parent.document.getElementById("telaEscura").style.display = "block";
        window.parent.document.getElementById('frameProdutos').contentWindow.location.reload();
    }

    function clicarCadastrar() {
	window.parent.document.getElementById("Cadastrar").style.display = "block";
        window.parent.document.getElementById("telaEscura").style.display = "block";
        window.parent.document.getElementById('frameCadastrar').contentWindow.location.href = "Cadastrar.jsp";
    }

    function clicarExcluir() {
	window.parent.document.getElementById("Excluir").style.display = "block";
        window.parent.document.getElementById("telaEscura").style.display = "block";
    }
